import "../styles/HomePage.css";

function HomePage() {
  return (
    <div className="home-container">
      <div className="worm-area">
        {Array.from({ length: 15 }).map((_, i) => (
          <div className="worm" key={i}></div>
        ))}
      </div>
      <h1>Welcome to the SOC Portal</h1>
    </div>
  );
}

export default HomePage;
